import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [divCount, setDivCount] = useState(0)

  const addToDivCount = () => {
    setDivCount(divCount + 1)
  }

  return (
    <div className="App">
      <button onClick={addToDivCount}> Add div </button>
      <h1> {divCount} </h1>
    </div>
  );
}

export default App;
